import './App.css';
import Home from './pages/Home';
import {BrowserRouter, Route,Routes} from "react-router-dom"
import Bio from './pages/Bio';

function App() {
  return (
  <BrowserRouter>
 <Routes>
 <Route path="/" element={<Home />}></Route>
 <Route path= "/bio" element={<Bio />}></Route>
</Routes>
 </BrowserRouter>
  );
}

export default App;
